import{_ as a,c as t,o as i,ag as o}from"./chunks/framework.Ds6Eueu6.js";const g=JSON.parse('{"title":"ALTER TRIGGER","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/ALTER_TRIGGER.md","filePath":"docs/7x/ref_guide/sql_commands/ALTER_TRIGGER.md"}'),s={name:"docs/7x/ref_guide/sql_commands/ALTER_TRIGGER.md"};function n(r,e,l,c,h,d){return i(),t("div",null,e[0]||(e[0]=[o('<h1 id="alter-trigger" tabindex="-1">ALTER TRIGGER <a class="header-anchor" href="#alter-trigger" aria-label="Permalink to &quot;ALTER TRIGGER&quot;">​</a></h1><p>Changes the definition of a trigger.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TRIGGER &lt;name&gt; ON &lt;table&gt; RENAME TO &lt;newname&gt;</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>ALTER TRIGGER</code> changes properties of an existing trigger. The <code>RENAME</code> clause changes the name of the given trigger without otherwise changing the trigger definition. You must own the table on which the trigger acts to be allowed to change its properties.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>name : The name of an existing trigger to alter.</p><p>table : The name of the table on which this trigger acts.</p><p>newname : The new name for the trigger.</p><h2 id="notes" tabindex="-1"><a id="section5"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>The ability to temporarily activate or deactivate a trigger is provided by <a href="./ALTER_TABLE.html">ALTER TABLE</a>, not by <code>ALTER TRIGGER</code>, because <code>ALTER TRIGGER</code> has no convenient way to express the option of activating or deactivating all of a table&#39;s triggers at once.</p><p>Note that WarehousePG has limited support of triggers in this release. See <a href="./CREATE_TRIGGER.html">CREATE TRIGGER</a> for more information.</p><h2 id="examples" tabindex="-1"><a id="section6"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>To rename an existing trigger:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>ALTER TRIGGER emp_stamp ON emp RENAME TO emp_track_chgs;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section7"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p><code>ALTER TRIGGER</code> is a WarehousePG extension of the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TABLE.html">ALTER TABLE</a>, <a href="./CREATE_TRIGGER.html">CREATE TRIGGER</a>, <a href="./DROP_TRIGGER.html">DROP TRIGGER</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',21)]))}const m=a(s,[["render",n]]);export{g as __pageData,m as default};
